import React from "react";
import '../image.css';

const ImageContainer = () => {
  return (

    <div className="image-container">
      <img src="https://images.pexels.com/photos/618833/pexels-photo-618833.jpeg" style={{ width: '300px', height: '200px' }}/>
    </div>
  )
};

export default ImageContainer;
